import React from 'react';

const SimplePage = () => {
    return (
        <header>
            <div className="HeaderTop w-[1440px] h-[47px] relative">
                <div data-layer="Задать вопрос" className="left-[1165px] top-[10px] absolute justify-start text-[#333333] text-sm font-medium font-['Montserrat'] leading-relaxed">Задать вопрос</div>
            </div>
        </header>
    );
};

export default SimplePage;
